import React, { useEffect } from 'react'
import { Outlet } from 'react-router-dom'
import { store } from '../../app/store'
import { employeeApiSlice } from '../employee/employeeApi/EmployeeApiSlice'

const prefetch = () => {
    useEffect(()=>{
        const employees = store.dispatch(employeeApiSlice.endpoints.listEmployee)
    },[])
  return <Outlet/>
}

export default prefetch
